import React from 'react';
import { Text } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import { StatusBar } from 'expo-status-bar';
import ViewAllMembers from './ViewAllMembers'
import AddOneCommittee from './AddOneCommittee'
import CommitteeDetailByMembers from './CommitteeDetailbyMember/CommitteeDetailByMembers'

const Stack = createStackNavigator();

 const CommitteesTab = () => {
  return (
    <>
    <StatusBar style="light" />
    <Stack.Navigator
    screenOptions={{
      headerStyle: {
        backgroundColor: '#29434e'
      }
    }}
    >
    <Stack.Screen
    name="viewAllcommittees"
    component={ViewAllCommittees}  
    options = {{
      title: 'Committees',
      headerTintColor: '#fff',
       }}
       />
       <Stack.Screen
       name="addOnecommittee"
       component={AddOneCommittee}
       options={{
         title: 'Add Committee',
         headerTintColor:"#fff"
       }}
       />
       <Stack.Screen
       name="committeedetailbymembers"
       component={CommitteeDetailByMembers}
       options={{
         title: 'Committee Detail',
         headerTintColor:"#fff"
       }}
       />
  </Stack.Navigator>
  </>
  )
}
export default CommitteesTab;
